import React from "react";
import GaugeChart from 'react-advanced-gauge-chart'


export default class Displaying extends React.Component{
  constructor(props) {
    super(props);
    var sensor = props.sensor
    var sensordata = props.sensor.sensordata;

    };

    render(){
      return (
        <tr>
        <th scope="row">{props.sensor.sensorid}</th>
        <td>{props.sensor.sensorname}</td>
        <td>{props.sensor.sensordata}</td>
        <td>
        <div class="progress">
          <div class="progress-bar" role="progressbar" aria-valuenow={props.sensor.sensordata}
              aria-valuemin="0" aria-valuemax="100" style={{width:`${props.sensor.sensordata}%`}}>
              {props.sensor.sensordata} %
          </div>
        </div>        
        </td>
        <td>

        </td>
      </tr>
      );
}
}
